import * as React from "react";
import {
  View,
  Text,
  StyleSheet,
  ImageBackground,
  StatusBar,
  Image,
  Pressable,
} from "react-native";
import { useNavigation } from "@react-navigation/native";
import { Color, FontFamily, Border, FontSize, Padding } from "../GlobalStyles";

const Groups = () => {
  const navigation = useNavigation();

  return (
    <View style={styles.groups}>
      <View style={[styles.clubsParent, styles.parentPosition]}>
        <Text style={styles.clubs} />
        <Text style={styles.text} />
        <Text style={styles.text} />
      </View>
      <View style={[styles.art1Parent, styles.topnavBg]}>
        <ImageBackground
          style={styles.art1Icon}
          resizeMode="cover"
          source={require("../assets/art1.png")}
        />
        <View style={styles.frameParent}>
          <View>
            <Text style={styles.bcs32}>{`BCS 3.2 `}</Text>
            <Text style={[styles.members, styles.pmTypo]}>5 members</Text>
          </View>
          <Text style={[styles.pm, styles.pmTypo]}>12:45 PM</Text>
        </View>
      </View>
      <View style={[styles.header, styles.headerPosition]}>
        <StatusBar style={styles.topnavBg} barStyle="default" />
      </View>
      <View style={[styles.bottomview, styles.headerPosition]}>
        <View style={[styles.bottomnav, styles.topnavBg]}>
          <Image
            style={styles.groupIcon}
            resizeMode="cover"
            source={require("../assets/HomeInactive.png")}
          />
          <Image
            style={[
              styles.iconsaxlinearprofile2user,
              styles.iconsaxlinearprofile2userSpaceBlock,
            ]}
            resizeMode="cover"
            source={require("../assets/iconsaxlinearprofile2user1.png")}
          />
          <Image
            style={[
              styles.iconsaxlinearmonitormobbile,
              styles.iconsaxlinearprofile2userSpaceBlock,
            ]}
            resizeMode="cover"
            source={require("../assets/iconsaxlinearmonitormobbile3.png")}
          />
          <Image
            style={[
              styles.iconsaxlinearmonitormobbile,
              styles.iconsaxlinearprofile2userSpaceBlock,
            ]}
            resizeMode="cover"
            source={require("../assets/iconsaxlinearmessage4.png")}
          />
        </View>
      </View>
      <Pressable
        style={[styles.iconPlusCircle, styles.parentPosition]}
        onPress={() => navigation.navigate("CreateGroup")}
      >
        <Image
          style={styles.vectorIcon}
          resizeMode="cover"
          source={require("../assets/vector2.png")}
        />
      </Pressable>
    </View>
  );
};

const styles = StyleSheet.create({
  parentPosition: {
    position: "absolute",
    alignItems: "center",
  },
  topnavBg: {
    backgroundColor: Color.white,
    flexDirection: "row",
  },
  pmTypo: {
    color: Color.dimgray,
    fontFamily: FontFamily.interRegular,
    textAlign: "left",
  },
  headerPosition: {
    left: 0,
    position: "absolute",
  },
  iconsaxlinearprofile2userSpaceBlock: {
    overflow: "hidden",
    marginLeft: 53.5,
  },
  clubs: {
    display: "none",
  },
  text: {
    marginLeft: 10,
    display: "none",
  },
  clubsParent: {
    top: 119,
    left: 116,
    alignItems: "center",
    flexDirection: "row",
  },
  art1Icon: {
    borderTopLeftRadius: Border.br_8xs,
    borderBottomLeftRadius: Border.br_8xs,
    width: 73,
    height: 73,
  },
  bcs32: {
    fontSize: FontSize.size_sm,
    fontWeight: "500",
    fontFamily: FontFamily.interMedium,
    color: Color.black,
    textAlign: "left",
  },
  members: {
    fontSize: FontSize.size_xs,
    marginTop: 21,
  },
  pm: {
    fontSize: FontSize.size_3xs,
    marginLeft: 178,
  },
  frameParent: {
    paddingHorizontal: 0,
    paddingVertical: 1,
    alignItems: "flex-end",
    justifyContent: "flex-end",
    marginLeft: 12,
    flexDirection: "row",
  },
  art1Parent: {
    top: 155,
    left: 4,
    borderRadius: Border.br_8xs,
    paddingHorizontal: Padding.p_7xs,
    paddingVertical: 0,
    alignItems: "center",
    position: "absolute",
  },
  header: {
    top: 0,
  },
  groupIcon: {
    height: 22,
    width: 20,
  },
  iconsaxlinearprofile2user: {
    height: 20,
    marginLeft: 53.5,
    width: 20,
  },
  iconsaxlinearmonitormobbile: {
    width: 24,
    height: 24,
    marginLeft: 53.5,
  },
  bottomnav: {
    height: 60,
    paddingHorizontal: Padding.p_12xl,
    paddingVertical: Padding.p_mini,
    alignItems: "center",
  },
  bottomview: {
    top: 792,
  },
  vectorIcon: {
    width: 51,
    height: 51,
  },
  iconPlusCircle: {
    top: 725,
    left: 320,
    alignItems: "center",
  },
  groups: {
    backgroundColor: Color.whitesmoke_100,
    flex: 1,
    width: "100%",
    height: 852,
  },
});

export default Groups;
